import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    loadMeetups: [
      { date: '2017-07-03', imageUrl: 'data:image/jpeg;base64,', id: '535554422', title: 'Meetup in new york' },
      { date: '2017-07-23', id: '3444', imageUrl: 'data:image/jpeg;base64,', title: 'Meetup in Paris' },
      { date: '2017-07-12', id: '8848', imageUrl: 'data:image/jpeg;base64,', title: 'Meetup in Senegal' },
      { date: '2017-07-09', id: '4339', imageUrl: 'data:image/jpeg;base64,', title: 'Meetup in Canada' },
      { date: '2017-07-06', id: '4882', imageUrl: 'https://lh3.googleusercontent.com/proxy/-EC5cMENIDYw8c_U66NGbyajtAyKKn4L5UjbFpBjctV68FZHCHSYlSubfkIvV2vdkhPvepXR-ZTNn7EvuDJbyW4hR677L_XdKuk8pJU59lkI6eqKny0FB9vQ75Xx8tugU7gcW-Zk2g', title: 'Meetup in Espagne' },
      { date: '2017-07-01', id: '3994', imageUrl: 'data:image/jpeg;base64,', title: 'Meetup in Bresilia' }
    ],
    user: {
      id: '3883',
      registeredMeetups: ['39393']
    }
  },
  mutations: {
    createMeetup (state, payload) {
      state.loadMeetups.push(payload)
    }
  },
  getters: {
    loadedMetups (state) {
      return state.loadMeetups
    },
    featuredMeetups (state) {
      return state.loadMeetups.slice(0, 5)
    },
    loadedMeetup (state) {
      return (meetupId: string) => {
        return state.loadMeetups.find((meetup) => {
          return meetup.id === meetupId
        })
      }
    }
  },
  actions: {
    createMeetup ({ commit }, payload) {
      const meetup = {
        title: payload.title,
        description: payload.description,
        imageUrl: payload.imageUrl,
        location: payload.loadMeetups,
        date: payload.date,
        id: 'lfkk'
      }
      // Reach out to firebase and store it
      commit('createMeetup', meetup)
    }
  },
  modules: {
  }
})
